import React from "react";
import logo from "/src/assets/Logo-w.png"
import "./Home.css"


function Home(){
    return(
        <>
            <div className="home--background">
        <h1>Bestellijst D&B Studio</h1>
        <img source={logo} alt="Logo D&B"/>
            </div>
        </>
    )
}

export default Home;
